use std::collections::HashMap;

struct Solution {}
impl Solution {
    fn target_letters_in(target: &HashMap<char, i32>, window: &HashMap<char, i32>) -> bool {
        if target.keys().len() > window.keys().len() {
            return false;
        }
        for (letter, qty) in target.into_iter() {
            if let Some(w_qty) = window.get(&letter) {
                if qty > w_qty {
                    return false;
                }
            } else {
                return false;
            }
        }
        return true;
    }
    pub fn min_window(s: String, t: String) -> String {
        let mut start = 0;
        let mut end = 0;
        let t_letters = t.chars().collect::<Vec<char>>();
        let s_letters = s.chars().collect::<Vec<char>>();
        let mut target = HashMap::new();
        let mut s_map = HashMap::new();
        let mut window = HashMap::new();
        let mut output = String::new();

        for letter in t_letters {
            *target.entry(letter).or_insert(0) += 1;
        }

        s_letters
            .clone()
            .into_iter()
            .for_each(|letter| *s_map.entry(letter).or_insert(0) += 1);
        if target.keys().len() > s_map.keys().len() {
            return output;
        }
        if s_letters.len() > 4 {
            while s_letters[start] == s_letters[start + 1]
                && s_letters[start] == s_letters[start + 2]
                && s_letters[start] == s_letters[start + 3]
            {
                if (start + 4) < s_letters.len() {
                    start += 1;
                    end += 1;
                }
            }
        }
        // println!("t: {:}", t);
        // println!("s: {:}", s);
        // println!("target: {:?}", target);

        while end < s.len() {
            end += 1;
            let next_letter = s_letters[end - 1];
            // println!("next letter: {:}", next_letter);
            *window.entry(next_letter).or_insert(0) += 1;

            // println!("start: {:}, end: {:}", start, end - 1);
            // println!("window: {:?}", window);

            while Solution::target_letters_in(&target, &window) {
                if Solution::target_letters_in(&target, &window) {
                    if output.is_empty() {
                        output.extend(&s_letters[start..(end)]);
                    } else {
                        let mut current_output = String::new();
                        current_output.extend(&s_letters[start..(end)]);
                        // println!("current_output: {:}", current_output);
                        if current_output.len() < output.len() {
                            output = current_output.clone();
                        }
                    }
                }
                let previous_letter = s_letters[start];
                start += 1;
                // println!("previous letter: {:}", previous_letter);
                *window.get_mut(&previous_letter).unwrap() -= 1;
                if *window.get(&previous_letter).unwrap() < 1 {
                    window.remove(&previous_letter);
                }
            }
        }

        return output;
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test_example_1() {
        let s = String::from("ADOBECODEBANC");
        let t = String::from("ABC");
        let result = Solution::min_window(s, t);
        assert_eq!(result, "BANC");
    }

    #[test]
    fn test_example_2() {
        let s = String::from("a");
        let t = String::from("a");
        let result = Solution::min_window(s, t);
        assert_eq!(result, "a");
    }

    #[test]
    fn test_example_3() {
        let s = String::from("a");
        let t = String::from("aa");
        let result = Solution::min_window(s, t);
        assert_eq!(result, "");
    }

    #[test]
    fn test_no_window() {
        let s = String::from("abcdef");
        let t = String::from("z");
        let result = Solution::min_window(s, t);
        assert_eq!(result, "");
    }

    #[test]
    fn test_duplicate_characters() {
        let s = String::from("aabcbcdbca");
        let t = String::from("aabc");
        let result = Solution::min_window(s, t);
        assert_eq!(result, "aabc");
    }

    #[test]
    fn test_non_existent_characters() {
        let s = String::from("bbbbbbbb");
        let t = String::from("acb");
        let result = Solution::min_window(s, t);
        assert_eq!(result, "");
    }
    #[test]
    fn test_case_sensitivity() {
        let s = String::from("");
        let t = String::from("aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ");
        let result = Solution::min_window(s, t);
        assert_eq!(
            result,
            "aAbBcCdDeEfFgGhHiIjJkKlLmMnNoOpPqQrRsStTuUvVwWxXyYzZ"
        );
    }
}
